import React from 'react';
import styled from 'styled-components';
import ModiLogo from '../static/modi-home-banner.png';


const IconWrapper = styled('img')`
	// height: 250px;
	width: 120%;
	display:none;

`


const Modi = () => (
	<IconWrapper src={ModiLogo}/>
)

export default Modi;
